/*Table structure for table `tbladmin` */

DROP TABLE IF EXISTS `tbladmin`;

CREATE TABLE `tbladmin` (
  `ad_id` int(10) NOT NULL AUTO_INCREMENT,
  `ad_name` varchar(25) DEFAULT NULL,
  `ad_username` varchar(25) DEFAULT NULL,
  `ad_password` varchar(25) DEFAULT NULL,
  `area_id` int(10) DEFAULT NULL,
  `ad_confP` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`ad_id`),
  KEY `FK_tbladmin` (`area_id`),
  CONSTRAINT `FK_tbladmin` FOREIGN KEY (`area_id`) REFERENCES `tblarea` (`area_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1;

