/*Table structure for table `tblarea` */

DROP TABLE IF EXISTS `tblarea`;

CREATE TABLE `tblarea` (
  `area_id` int(10) NOT NULL AUTO_INCREMENT,
  `area_name` varchar(25) DEFAULT NULL,
  `are_tot_vote` int(25) DEFAULT NULL,
  `ad_id` int(25) DEFAULT NULL,
  `party_id` int(10) DEFAULT NULL,
  `can_id` int(10) DEFAULT NULL,
  `voter_id` int(10) DEFAULT NULL,
  `province` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`area_id`),
  KEY `FK_tblarea` (`ad_id`),
  KEY `FK_tblarea_ref_tblcandidate` (`can_id`),
  KEY `FK_tblarea_ref_tblparty` (`party_id`),
  KEY `FK_tblarea_ref_tblvoter` (`voter_id`),
  KEY `area_name` (`area_name`),
  KEY `province` (`province`),
  CONSTRAINT `FK_tblarea` FOREIGN KEY (`ad_id`) REFERENCES `tbladmin` (`ad_id`),
  CONSTRAINT `FK_tblarea_ref_tblcandidate` FOREIGN KEY (`can_id`) REFERENCES `tblcandidate` (`can_id`),
  CONSTRAINT `FK_tblarea_ref_tblparty` FOREIGN KEY (`party_id`) REFERENCES `tblparty` (`party_id`),
  CONSTRAINT `FK_tblarea_ref_tblvoter` FOREIGN KEY (`voter_id`) REFERENCES `tblvoter` (`voter_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

