/*Table structure for table `tblcandidate` */

DROP TABLE IF EXISTS `tblcandidate`;

CREATE TABLE `tblcandidate` (
  `can_id` int(10) NOT NULL AUTO_INCREMENT,
  `can_name` varchar(25) DEFAULT NULL,
  `can_party` varchar(25) DEFAULT NULL,
  `can_image` tinyblob,
  `province` varchar(25) DEFAULT NULL,
  `City` varchar(25) DEFAULT NULL,
  `Code` int(10) DEFAULT NULL,
  `area_name` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`can_id`),
  KEY `FK_tblcandidate_ref` (`can_party`),
  KEY `FK_tblcandidate_ref_tblarea` (`area_name`),
  CONSTRAINT `FK_tblcandidate_ref` FOREIGN KEY (`can_party`) REFERENCES `tblparty` (`party_name`),
  CONSTRAINT `FK_tblcandidate_ref_tblarea` FOREIGN KEY (`area_name`) REFERENCES `tblarea` (`area_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

