/*Table structure for table `tblvote` */

DROP TABLE IF EXISTS `tblvote`;

CREATE TABLE `tblvote` (
  `vote_id` int(10) NOT NULL AUTO_INCREMENT,
  `party_name` varchar(25) NOT NULL,
  `voter_id` int(10) NOT NULL,
  `area_name` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`vote_id`),
  KEY `FK_tblvote_ref_tblparty` (`party_name`),
  KEY `idNo` (`voter_id`),
  KEY `area_name` (`area_name`),
  CONSTRAINT `FK_tblvote_ref` FOREIGN KEY (`area_name`) REFERENCES `tblarea` (`area_name`),
  CONSTRAINT `FK_tblvote_ref_tblparty` FOREIGN KEY (`party_name`) REFERENCES `tblparty` (`party_name`),
  CONSTRAINT `FK_tblvote_ref_tblvoter` FOREIGN KEY (`voter_id`) REFERENCES `tblvoter` (`voter_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1;

/*Data for the table `tblvote` */

