/*Table structure for table `tblvoter` */

DROP TABLE IF EXISTS `tblvoter`;

CREATE TABLE `tblvoter` (
  `voter_id` int(10) NOT NULL AUTO_INCREMENT,
  `voter_name` varchar(25) DEFAULT NULL,
  `voter_IdNo` varchar(13) NOT NULL,
  `voter_phoneNo` varchar(10) DEFAULT NULL,
  `voter_Email` varchar(25) DEFAULT NULL,
  `area_name` varchar(25) DEFAULT NULL,
  `city` varchar(25) DEFAULT NULL,
  `code` int(10) DEFAULT NULL,
  `province` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`voter_id`),
  KEY `voter_IdNo` (`voter_IdNo`),
  KEY `FK_tblvoter` (`area_name`),
  KEY `province` (`province`),
  CONSTRAINT `FK_tblvoter` FOREIGN KEY (`area_name`) REFERENCES `tblarea` (`area_name`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=latin1;

